CREATE TABLE About(
    aName nvarchar(50) NOT NULL,
    aAddress nvarchar(150) NOT NULL,
    aPhone nvarchar(11) NOT NULL,
    aEmail nvarchar(50) NOT NULL,
    aOpening nvarchar(50) NOT NULL,
    aView int NOT NULL,
    aDescription nvarchar(1000) NULL,
    aImage longtext NULL,
    aComboName nvarchar(50) NOT NULL,
    aComboImage longtext NULL,
    aComboDescription nvarchar(1000) NULL
    )
Create table Admin (username varchar(16) primary key, password varchar(16) not null);
Create table Coffee(cId int auto_increment primary key , cName nvarchar(50) not null, cDescription mediumtext not null, cPrice double not null, cImage mediumtext);
Create table Combo(cbId int auto_increment primary key , cbName varchar(50) not null, cbPrice double not null, cbImage longtext );
Create table Combo_Coffee(cbId int not null, cId int not null, ccQuantity int not null, constraint primary key (cbId,cId));
Select * from Coffee;
INSERT into Coffee VALUES (10, N'Match đá xay', N'Matcha đá xay (còn gọi là trà xanh đá xay hay matcha ice blended) là món thức uống đầy hấp dẫn khi được kết hợp hoàn hảo giữa vị béo ngậy của sữa, chút thanh mát từ bột và syrup trà xanh, quyện cùng cảm giác thơm thoang thoảng dịu nhẹ của bột vanilla.', 49000, N'data:image/jpeg;base64,')
INSERT into Coffee VALUES (13, N'Trà chanh', N'Trà chanh là một thức uống giải khát được kết hợp cân bằng giữa vị thanh chát dịu của trà cùng vị chua của chanh tạo nên thứ đồ uống độc đáo.', CAST(10000.00 AS Decimal(18, 2)), N'data:image/png;base64,');
INSERT into Coffee VALUES (16, N'Sinh tố', N'Sinh tố là một loại thức uống được tạo nên từ những loại trái cây tươi, có chứa rất nhiều những khoáng chất và vitamin cần thiết cho việc phát triển cũng như duy trì sức khỏe của cơ thể con người.', CAST(25000.00 AS Decimal(18, 2)), N'data:image/png;base64,');
INSERT into Coffee VALUES (18, N'Bạc xỉu', N'Đó cũng chính là nguồn gốc của những ly bạc xỉu. Bạc xỉu là từ mà người Sài Gòn gọi tắt của cụm từ "bạc tẩy xỉu phé" (là tiếng Quan Thoại phổ biến trong cộng đồng người Hoa ở Sài Gòn lúc bấy giờ) để chỉ món sữa nóng thêm một chút cà phê.', CAST(29000.00 AS Decimal(18, 2)), N'data:image/png;base64,');
INSERT into Coffee VALUES (20, N'Trà sữa', N'Trà sữa là loại thức uống đa dạng được tìm thấy ở nhiều nền văn hóa, bao gồm một vài cách kết hợp giữa trà và sữa. Các loại thức uống khác nhau tùy thuộc vào lượng thành phần chính của mỗi loại, phương pháp pha chế, và các thành phần khác được thêm vào.', CAST(22000.00 AS Decimal(18, 2)), N'data:image/png;base64,');
INSERT into Coffee VALUES (21, N'Bánh mì', N'Bánh mì Việt Nam giòn thơm, với nhân thịt viên hấp dẫn, phủ thêm một lớp nước sốt cà chua ngọt, cùng với rau tươi và gia vị đậm đà.', CAST(19000.00 AS Decimal(18, 2)), N'data:image/png;base64,');
INSERT into Coffee VALUES (22, N'Bánh mouse đào', N'Một sự kết hợp khéo léo giữa kem và lớp bánh mềm, được phủ lên trên vài lát đào ngon tuyệt.', CAST(29000.00 AS Decimal(18, 2)), N'data:image/png;base64,');
